import React from 'react'
import './card.css'

function Card() {
  return (
    <div className='row'>
      <h2>Title</h2>
        <div className='post'>
            <img className='poster' src="https://www.comingsoon.net/assets/uploads/2021/12/FFzlXHlXoAIdHvW.jpeg" alt="" />

        </div>
    </div>
  )
}

export default Card
